func lbPropForRune(r rune) lbProp {
	if r < 256 {
		return lbAsciiLookupTbl[r]
	}

	i, j := 0, len(lbRanges)
	for i < j {
		mid := i + (j-i)/2
		rng := lbRanges[mid]
		if rng.Start <= r && r <= rng.End {
			return rng.Prop
		} else if r < rng.Start {
			j = mid
		} else {
			i = mid + 1
		}
	}
	return lbPropNone
}
